/////////////////////////////////////////////////////
// Orloy clock
// copyright CC BY-SA  Mihailenko Alexey 2019
/////////////////////////////////////////////////////

(function() {

const timeScale=1; // 24*60;

const pragueLatitude = 50.0880400;
const dayLength=24*60*60;

function hourHandAngle(time) {
  const seconds=(time.getUTCHours()+1)*3600
      + time.getUTCMinutes()*60
      + time.getUTCSeconds();
  const angle= (seconds*360/dayLength + 360) % 360;
  return angle;
}

function setHourHand(time) {
  const angle = hourHandAngle(time);
  const elem=document.getElementById("ruka");
  elem.setAttribute("transform", 
      `translate(-52.289323,-33.240495) rotate(${angle.toFixed(2)}, 130, 111)`);
}

function zodiakAngle(time) {
  const starToSunTime=1.002737909350795;
  const starTime=new Date(time.valueOf()*starToSunTime);
  const seconds = (starTime.getUTCHours()+1)*3600 
      + starTime.getUTCMinutes()*60
      + starTime.getUTCSeconds();
  const angle = (seconds*360/dayLength + 360) % 360;
  return angle;
}

function setZodiac(time) {
  const angle = zodiakAngle(time);
  const elem=document.getElementById("zodiak");
  elem.setAttribute("transform", 
      `translate(-52.289323,-33.240495) rotate(${angle.toFixed(2)}, 130, 111)`);
}

function deg2rad (angle) {
  return angle*Math.PI/180;
}

function rad2deg (angle) {
  return angle*180/Math.PI;
}

function setSunPosition(time) {

  const deltaAngle = 169 + hourHandAngle(time) - zodiakAngle(time);
  const r = 40; // zodiac radius
  const delta = 18; // dinstance between zodiac center and zodiac axis
  // squere root factors
  const a = 1;
  const b = -2*delta*Math.cos(deg2rad(deltaAngle));
  const c = delta*delta-r*r;
  // only positeve root
  r1 = (-b + Math.sqrt(b*b-4*a*c))/(2*a);
  // get sun coords
  hhAngle=deg2rad(hourHandAngle(time)+90);
  dx = r1 * Math.cos(hhAngle);
  dy = r1 * Math.sin(hhAngle);
  // sun spin
  ss=hourHandAngle(time);
  // set sun coords
  const elem=document.getElementById("slunce");
  elem.setAttribute("transform", 
      `translate(-51.9,-60.2) translate(${dx.toFixed(2)}, ${dy.toFixed(2)}) rotate(${ss.toFixed(2)}, 129.7, 138.2)`);
}

function moonAngle(time) {
  const sunToMoonTime = (1-1/29.530588);
  const moonTime=new Date(time.valueOf()*sunToMoonTime);
  const seconds = (moonTime.getUTCHours()+1)*3600 
      + moonTime.getUTCMinutes()*60
      + moonTime.getUTCSeconds();
  const angle = (seconds*360/dayLength + 81.2 +360) % 360;
  return angle;
}

function setMoonPosition(time) {
  const deltaAngle = 169 + moonAngle(time) - zodiakAngle(time);
  const r = 40; // zodiac radius
  const delta = 18; // dinstance between zodiac center and zodiac axis
  // squere root factors
  const a = 1;
  const b = -2*delta*Math.cos(deg2rad(deltaAngle));
  const c = delta*delta-r*r;
  // only positeve root
  r1 = (-b + Math.sqrt(b*b-4*a*c))/(2*a);
  // get moon coords
  hhAngle=deg2rad(moonAngle(time)+90);
  const dx = r1 * Math.cos(hhAngle);
  const dy = r1 * Math.sin(hhAngle);
  // moon spin
  const sp =  moonAngle(time);
  // set moon coords
  const elem=document.getElementById("luna");
  elem.setAttribute("transform", 
      `translate(-19.3,-33)  \
       translate(${dx.toFixed(2)}, ${dy.toFixed(2)}) \
       rotate(${sp.toFixed(2)}, 97, 110.8)`);
}


function setMoonPhase(time) {
  // calculating parametrs
  const delta= (hourHandAngle(time) - moonAngle(time) + 360) % 360 ;
  const initR = 3.2092;
  const initX = 90.67;
  var fgColor, bgColor, dr, dx, x;
  const darkColor="#1c1828";
  const lightColor="#dcdcdc";
  if(delta<180) {
    // increasing
    if(delta<90) {
      bgColor=lightColor; fgColor=darkColor;
      dx=(delta%90)/180;
      dr=0.554+0.225/(0.5-Math.min(dx,0.499));
      x = initX - initR*(1 - dx*2 - dr);
    } else {
      bgColor=darkColor; fgColor=lightColor;
      dx=0.5-(delta%90)/180;
      dr=0.554+0.225/(0.5-Math.min(dx,0.499));
      x = initX + initR*(1 - dx*2 - dr);
    }
  } else {
    // decreasing
    if(delta<270) {
      bgColor=darkColor; fgColor=lightColor;
      dx=(delta%90)/180;
      dr=0.554+0.225/(0.5-Math.min(dx,0.499));
      x = initX - initR*(1 - dx*2 - dr);
    } else {
      bgColor=lightColor; fgColor=darkColor;
      dx=0.5-(delta%90)/180;
      dr=0.554+0.225/(0.5-Math.min(dx,0.499));
      x = initX + initR*(1 - dx*2 - dr);
    }
  }
  // elements
  const gradStop1 = document.getElementById("moon-shadow-linear-1");
  const gradStop2 = document.getElementById("moon-shadow-linear-2");
  const radialGradient=document.getElementById("moon-shadow");
  const moonBackground=document.getElementById("moon-background");
  // adjusting elements
  moonBackground.style.fill=bgColor;
  gradStop1.style.stopColor=fgColor;
  gradStop2.style.stopColor=fgColor;
  radialGradient.setAttribute("cx", x.toFixed(2));
  radialGradient.setAttribute("fx", x.toFixed(2));
  radialGradient.setAttribute("r", (initR*dr).toFixed(2));
}


function setOldItalianTimeDial(time) {
  // day of year
  const day = (time.valueOf() % (365.2422*24*60*60*1000))/(60*60*24*1000);
  // sun declination
  const decl = deg2rad(23.45)*Math.sin(2*Math.PI*(day-81)/365);
  // hour angle
  const angle = Math.acos((Math.sin(decl)*Math.sin(deg2rad(pragueLatitude))+0.145) /
                (Math.cos(decl)*Math.cos(deg2rad(pragueLatitude))));
  const discAngle= 53 - rad2deg(angle);
  // console.log(discAngle);
  const elem = document.getElementById("stary-cifernik");
  elem.setAttribute("transform", 
      `translate(-52.289323,-33.240495)  \
       rotate(${(discAngle).toFixed(2)}, 130, 110.8)`);
}

const startDate=(new Date()).valueOf();

function setCurrentState() {
  var now = new Date(startDate + ((new Date()).valueOf() - startDate)*timeScale);
  setHourHand(now);
  setZodiac(now);
  setSunPosition(now);
  setMoonPosition(now);
  setMoonPhase(now);
  setOldItalianTimeDial(now);
}

// run
setCurrentState();
setInterval(setCurrentState, timeScale<10 ? 10000 : 10);

})();
